import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const Register = () => {
  return (
    <View>
      <Text style={styles.h1}>Register</Text>
    </View>
  )
}

export default Register

const styles = StyleSheet.create({
  h1: {
    height: 100,
    width:200
  }
})
